class Logo extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      isAnimated: false
    };
  }

  componentDidMount() {
    let timeline = anime.timeline();

    timeline
      .add({
        targets: 'header.header-wrapper',
        opacity: [0, 1],
        easing: 'easeInOutQuad',
        duration: 600,
        offset: '+=400'
      })
      // .add({
      //   targets: 'div.nav',
      //   translateY: [-75, 0],
      //   opacity: [0, 1],
      //   easing: 'easeInOutQuad',
      //   duration: 400,
      //   offset: '-=400'
      // })
      .add({
        targets: [, '#path1_stroke', '#path2_stroke','#path0_stroke'],
        strokeDashoffset: [anime.setDashoffset, 0],
        easing: 'easeInOutSine',
        duration: 2000,
        direction: 'alternate',
      })
      .add({
        targets: ['#path0_fill', '#path1_fill', '#path2_fill'],
        opacity: [0, 1],
        easing: 'easeInOutSine',
        duration: 2000,
        offset: '-=1500',
      })
      .add({
        targets: ['div.description > .anime-group'],
        opacity: [0, 1],
        delay: function(el, i, l) {
          return i * 150;
        },
        easing: 'easeInOutQuad',
        duration: 600,
        offset: '-=800'
      });

  }

  render() {
    return (
      <div className="logo">
        <LogoSVG/>
      </div>
    )
  }
}

class HeaderWrapper extends React.Component {
  render() {
    return (
       <header className="header-wrapper" style={{}}>
        <Title />
      </header>
    )
  }
}

function handleApply() {
  window.location.href = "https://uclafoundersschool.typeform.com/to/G7VxEU";
}

function handleSponsor() {
  window.location.href="mailto:uclafoundersschool@gmail.com?Subject=Thanks%20for%20your%20interest%20in%20Founders%20School%202016!";
}

class Description extends React.Component {
  render() {
    return (
      <div className="description-wrapper">
        <div className="description">
          <div className="anime-group" id="upper-bracket"></div>
          <h1 className="anime-group">Tech Meets <span>Entrepreneurship</span></h1>
          <p className="anime-group">SoCal’s Largest University Entrepreneurship Conference</p>
          <form className="anime-group" id="mailinglist">
            <input type="text" name="fancy-text" id="fancy-text" placeholder="Join our mailing list"/>
            <button type="submit" for="fancy-text">Submit</button>
          </form>
          <div className="anime-group" id="lower-bracket"></div>
        </div>
      </div>
    )
  }
}

